export class SearchBox extends Component {

    state = {
       name: ""
    }


    render() {
        return (
            <div>
                <input name="name" placeholder="Name" value={this.state.value}>  </input>
                <button>Submit Score </button>
            </div>
        )
    }
}

export default SearchBox
